angeManageAccount:"Manage Account",fExchangeConvertYourFlat:"CONVERT YOUR FIAT TO FiAT-D",fExchangeExchange:"EXCHANGE",fExchangeBlockchainDriven:"Blockchain-driven Exchange for Tokenized Foreign Currency",fExchangeTraditionalForex:"What Make Us Different From Traditional Forex",fExchangeSafer:"Safer",fExchangeSaferDesc:"Tokenized fiat is managed by multiple third-party trust companies worldwide. Asset reserves are audited by third-party accounting firms on a quarterly basis. ",fExchangeCheaper:"Cheaper",fExchangeCheaperDesc:"Low exchange cost 55 F-Site transaction fee can be as low as 0.1%.",fExchangeTransparency:"Transparency",fExchangeTransparencyDesc:"All forex trading records are securely logged on the blockchain",fExchangeConvertInstantly:"Convert Your Fiat to Fiat-D Instantly",fExchangeCollaboration:"In Collaboration with DaoCoin",ExchangeTransparencyConvert:"Transparency",fExchangeTransparencyOne:"A fund management system you can trust ",fExchangeTransparencyOnedesc:"DaoCoin do not handle funds. Instead, multiple trust companies around the world interact with DaoCoin on an API level to issue and redeem tokens.",fExchangeTransparencyTwo:"Real time APIs to prove 1:1 parity ",fExchangeTransparencyTwodesc:"Trust companies use real time APIs for proof-of-funds while DaoCoin utilizes real time API for proof-of-token. Both of these values are displayed to our users in real time.",fExchangeTransparencyThird:"Third-party auditing ",fExchangeTransparencyThirddesc:"We value the importance of openness and transparency. A third-party auditing firm will conduct an audit on a quarterly basis, giving our users total peace of mind.",fExchangeEfficiency:"Efficiency",fExchangeEfficiencyOne:"Multiple nodes worldwide for AML and deposition of funds ",fExchangeEfficiencyOnedesc:"To improve the efficiency of legal clearance and flow of funds, DaoCoin has established a worldwide network of AML checkpoints and fund-depositing pipelines. Per customer region, DaoCoin can auto-switch between these nodes for the most efficient choice.",fExchangeEfficiencyTwo:"Off-the-shelf widgets for issue and redeem ",fExchangeEfficiencyTwodesc:"DaoCoin offer a set of streamlined, customizable ecommerce-style widgets for the issuance  and redemption  of tokens.  Widgets can be embedded into your webpages or apps in minutes.",fExchangeSwal:"Trading starts soon, open your account now!",SiteMainboard:"US Stock Market",HomeAdvantage:"What Makes Us Different to Traditional Stock Exchange",HomeAdvantageTit1:"One-stop for Global Top Stocks",HomeAdvantageBrief1:"Through stock tokenization, 55 Global Markets is able to bring together reliable stocks into one single trading platform in form of tokenized stock. As comparing to traditional stock exchange that in restraint of time, location and local regulation, this mechanism significantly expands liquidity so to eliminate illiquidity discounts on assets.",HomeAdvantageTit2:"Truly for Global Investors",HomeAdvantageBrief2:"55 Global Markets firmly believe that reliable stocks should be made available for everyone. Here in 55 Global Markets, one stock share can be fragmented to the millionth,thus greatly reducing the investment threshold.",HomeAdvantageTit3:"Round-the-clock Trading",HomeAdvantageBrief3:"The round-the-clock trading system removed the time barrier so to bring in broader liquidity into the market. This also brings enormous opportunities for institutional investors and algorithmic-trading teams.",HomeAdvantageTit4:"Rapid Clearing & Settlement",HomeAdvantageBrief4:"Utilizing blockchain technology, trading of stock tokens can be confirmed highly efficiently comparing to traditional stock exchange. With smart contract, middlemen brokering stock exchange can be removed so to increase efficiency.",HomeAdvantageTit5:"Built-in Compliance, by DaoStock",HomeAdvantageBrief5:"In collaboration with DaoStock, 55 Global Markets can create digitalrepresentationof the underlying stock and private equity. DaoStock is developing built-in compliance interface allowing stock token to be exchanged around world and compliance to local regulations.",HomeAdvantageTit6:"Trading Platform for Unicorn",HomeAdvantageBrief6:"For those privately-owned unicorn companies, 55 Global Markets provided a marketplace to trade tokenized share before they are publicly listed. 55 brings together worldwide investors to set a better pre-IPO pricing, allowing unicorns to achieve a more successful IPO.",LTitle:"L-Site",LTitleContent:"Local Token Exchange",LTitleDetails:"Exchange Local Business Tokens with Worldwide Investors and Local Consumers",LBtnOpen:"Open Account",LBtnManage:"MANAGE ACCOUNT",LBtnJoin:"Trade Starts in October, Join our Telegram Chat Now!",LHomePage:"L-Home",LPart1Title1:"Local Business Tokens for ",LPart1Title2:"Worldwide Investors",LPart1:"Providing tokenization utilities for local business to tokenize customer loyalty points, pre-paid cards or crowdfund new products.",LPart2:"Providing exchange marketplaces of such tokens for local consumers and worldwide investors.",LPart2Title1:"An Open Eco for Distributed",LPart2Title2:"Business Token Exchange",LPart3:"L-Site modulized its listing component, buy/sell component and payment component into SDKs so that third-party apps can embed it in minutes.",LPart4:"L-Site also provides a turn-key solution for local business to bootstrap deployment.",LPart3Title1:"Location, Location, Location",LPart5:"L-Site helps local business tokens to be traded between investors worldwide, in the mean time, L-Site also facilitates local consumers to discover relevant business tokens per location and profile through collaborating with third-party mobile apps.",LPart6:"",LPart5Title:"A Transparent Community-driven Exchange",LPart5ContentTitle1:"Escrow to Issue",LPart5ContentTitle2:"Governance Token",LPart5ContentTitle3:"Information Disclosure",LPart5Content1:"Local businesses must escrow a certain amount of L-Site governance tokens to be qualified for tokenization.",LPart5C